#!/usr/bin/env python

"""
Prints the color map as a table.

Author: Robin Schmid
Date: Mar 2023
"""

from matplotlib import cm

if __name__ == "__main__":
    table = cm.RdYlGn(range(256))[:, :3]

    table = list(table)

    table = str(table)

    table = table.replace("array", "").replace("([", "{").replace("])", "}")

    print(table)

